const Search = ({query,queryFunction,completed,completedFunction}) => {
return(
    <>
    <lable>Search:</lable>
    <input 
    type="text"
    name="q"
    id="q"
    value ={query}
    onChange={queryFunction}
    />
    <lable>Show completed:</lable>
    <input 
    type="checkbox"
    value ={completed}
    onChange={completedFunction}

    />
    </>
)
}

export default Search;
